import time

'''
  To take an input of n indicating a target and 
  and an array of integers. 
  Find the no. of pairs in the array, whose differences is equal to the target.
  :param target: The target value
  :type target: int
  :param arr: The list containing the integers
  :type arr: list<int>
  :return: The no. of pairs whose respective differences is equal to the target
  :rtype: int
'''
cache = dict()

def pairs(k, arr):
  arr = set(arr)
  return sum(1 for i in arr if i+k in arr)
    

